            })
            .catch(err => {
              res.send('error:' + err)
            })
        })
      } else {
        res.json({error: 'User already exists'})
      }
    })
    .catch(err => {
      res.send('error:' + err)
    })

})

users.post('/login', (req, res) => {
  User.findOne({
    email: req.body.email
  }).then(user => {
    console.log('response')
